    false,nt"url": null,nt"notes": "Grassy Island near Ecorse, MI Undefined
    Aquifer Detroit River International Wildlife Refuge, Michigan.  Datum of records
    is Land surface and top of casing datum is in North American Vertial Datum (NAVD)
    of 1988 for every monitoring well. The period of record is from October 2010 to
    present.  Hobo dataloggers were deployed in 30 wells across Grassy Island, part
    of Detroit River International Wildlife Refuge. Groundwater level and temperature
    data are collected at six hour intervals. The installation of wells and continuous
    monitoring of groundwater levels at Grassy Island was initiated to guide the conceptual
    design of a remedy to address potential contaminant seepage from the Island into
    the Detroit River",nt"license_title": "License Not Specified",nt"extras":
